@test integrate((A+B*log(e*(a+b*x)^n*(c+d*x)^(-1n)))^2*(h*(a*g*x+b*f*x)+a*f*h+b*g*h*x^2)^-1, x) == :(-1*h^-1*(A+B*log(e*(a+b*x)^n*(c+d*x)^(-1n)))^2*(b*f+-1*a*g)^-1*log(1+-1*(a+b*x)^-1*(d*f+-1*c*g)^-1*(c+d*x)*(b*f+-1*a*g))+2*B^2*h^-1*n^2*(b*f+-1*a*g)^-1*Polylogarithms.polylog(3,(a+b*x)^-1*(d*f+-1*c*g)^-1*(c+d*x)*(b*f+-1*a*g))+2*B*n*h^-1*(b*f+-1*a*g)^-1*(A+B*log(e*(a+b*x)^n*(c+d*x)^(-1n)))*Polylogarithms.polylog(2,(a+b*x)^-1*(d*f+-1*c*g)^-1*(c+d*x)*(b*f+-1*a*g)))
